    const [filteredPeternakan, setFilteredPeternakan] = useState(allPeternakan);

    const handleSearch = (event) => {

    }

    useEffect(() => {
        axios('http://localhost:8000/api/pet_pro')
        .then(response => {
            console.log(response.data)
            setAllPeternakan(response.data);
            setFilteredPeternakan(response.data);
        })
        .catch(error => {
            console.log('Error getting fake data: ' + error);
            })
            }, []);

  return (
        <div style={{ margin: '0 auto', marginTop: '10%' }}>
        <label>Search:</label>
        <input type="text" onChange={(event) =>handleSearch(event)} />
        </div>
  )
}

export default Search
